import React from "react";
// eslint-disable-next-line
import css from "../css/slideMenu.css";

const SlideMenu = () => {
  const test = false;

  return <div className={`if (${test}) ? slide-menu : close`}>SlideMenu</div>;
};

export default SlideMenu;
